tables.table_schema:
CREATE TABLE customers (
  customer_id INT PRIMARY KEY,
  customer_name VARCHAR(50) NOT NULL,
  customer_email VARCHAR(100) UNIQUE
);

CREATE TABLE savings_plan (
  plan_id INT PRIMARY KEY,
  customer_id INT REFERENCES customers(customer_id),
  contribution_amount DECIMAL(10, 2),
  contribution_date TIMESTAMP
);

CREATE TABLE Customer ( customer_id INT, name TEXT, email TEXT, PRIMARY KEY (customer_id) );

CREATE TABLE SavingsPlan ( plan_id INT, plan_name TEXT, plan_type TEXT, PRIMARY KEY (plan_id) );

CREATE TABLE Contribution ( contribution_id INT, customer_id INT, plan_id INT, amount DECIMAL, timestamp TIMESTAMP, PRIMARY KEY (contribution_id), FOREIGN KEY (customer_id) REFERENCES Customer(customer_id), FOREIGN KEY (plan_id) REFERENCES SavingsPlan(plan_id) );

CREATE TABLE CustomerNoContribution ( customer_id INT, last_interaction_date TIMESTAMP, PRIMARY KEY (customer_id), FOREIGN KEY (customer_id) REFERENCES Customer(customer_id) );

CREATE TABLE customers (
  customer_id INT PRIMARY KEY,
  customer_name VARCHAR,
  savings_plan_account_id INT
);

CREATE TABLE savings_plan_accounts (
  account_id INT PRIMARY KEY,
  account_type VARCHAR
);

CREATE TABLE contributions (
  contribution_id INT PRIMARY KEY,
  customer_id INT,
  contribution_amount DECIMAL,
  contribution_date DATE
);

CREATE TABLE activity_logs (
  log_id INT PRIMARY KEY,
  customer_id INT,
  activity_description TEXT,
  log_date TIMESTAMP
);
